import React from 'react';
import styles from './Dashboard.module.scss'


export const Dashboard = () => {
    return (
        <div className={styles.dashWrap}>
            <div className={styles.props}>My Properties</div>
            <div className={styles.netw}>New Worth</div>
            <div className={styles.fmv}>Total FMV</div>
            <div className={styles.mort}>Total Mortgage Amount</div>
        </div>
    )
}

export default Dashboard;
